import React from 'react';
import logo from './logo.svg';
import './App.css';

function NavBarIcon(props) {
    return (
        <div 
            className={props.active ? 'navBarIcon open': "navBarIcon"} 
            onClick={props.onClick} >
            <div className="bar1"></div>
            <div className="bar2"></div>
            <div className="bar3"></div>
        </div>
    )
}

function NavBarOpen(props) {
  return (
    <div
      className={props.active ? 'navBar open': 'navBar'}
      onClick={props.onClick}>
      <div className="navBarIcon">
        <NavBarIcon active={this.state.active} onClick={this.toggleClass.bind(this)}/>
      </div>
    </div>
  )
}

class NavBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      active: false,
      navTabs: Array(2).fill(null),
    };
  }

  renderNavBar() {
    return (
    <div className="navBar">
      <NavBarOpen active={this.state.active} onClick={this.toggleClass.bind(this)}/>

    </div>

    );
  }

  toggleClass() {
    const currentState = this.state.active;
    this.setState({ active: !currentState });
  };

  render() {
    return (
      <div className={this.props.active ? 'navBar open': "navBar"}>
        <div className="navBarIcon">
          {this.renderNavBar()}
        </div>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="header">
        <h1>Scheduler</h1>
      </div>
      <NavBar/> 
    </div>
  );
}

export default App;
